import React from 'react';
import { useRouter } from '../contexts/RouterContext';

const Link = ({ to, children, className, params }) => {
  const { navigate } = useRouter();
  return (
    <button onClick={() => navigate(to, params)} className={className || "text-blue-600 hover:text-blue-800 underline"}>
      {children}
    </button>
  );
};

export default Link;
